import React from "react";

class Checkbox extends React.Component {
 constructor(props) {
   super(props);

   this.state = {
    course: [],
    checked: true,
   };
 }


  render() {
    return <input
      name="checkbox"
      type="checkbox"
      checked={this.state.checked}
      />;
  }
}

export default Checkbox;
